  state = {
    person:[
      {name:'Jerry'}
    ]
  }
  render(){
    return (
      <div className="App">
        <h1>Hello React!</h1>
        <Person name = "Jerry"/>
        <Person name = "Lucy"/>
        <Person name = "Alex">This is content.</Person>
      </div>
    );
  }
}

export default App;
